import "./App.css";
import React from "react";
import { useQuery } from "react-query";

function Home() {
  const getNotes = async () => {
    const res = await fetch("http://localhost:5000/notes");
    return res.json();
  };
  // Using the hook
  const { data, error, isLoading } = useQuery("randomFacts", getNotes);

  return (
    <div>
      <p>HOME</p>
    </div>
  );
}

export default Home;
